query:
fragment ProductErrorFragment on ProductError {
  code
  field
  __typename
}

fragment ProductImageFragment on ProductImage {
  id
  alt
  sortOrder
  url
  __typename
}

fragment Money on Money {
  amount
  currency
  __typename
}

fragment ProductVariantAttributesFragment on Product {
  id
  attributes {
    attribute {
      id
      slug
      name
      inputType
      valueRequired
      values {
        id
        name
        slug
        __typename
      }
      __typename
    }
    values {
      id
      name
      slug
      __typename
    }
    __typename
  }
  productType {
    id
    variantAttributes {
      id
      name
      values {
        id
        name
        slug
        __typename
      }
      __typename
    }
    __typename
  }
  pricing {
    priceRangeUndiscounted {
      start {
        gross {
          ...Money
          __typename
        }
        __typename
      }
      stop {
        gross {
          ...Money
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}

fragment StockFragment on Stock {
  id
  quantity
  quantityAllocated
  warehouse {
    id
    name
    __typename
  }
  __typename
}

fragment WeightFragment on Weight {
  unit
  value
  __typename
}

fragment MetadataItem on MetadataItem {
  key
  value
  __typename
}

fragment MetadataFragment on ObjectWithMetadata {
  metadata {
    ...MetadataItem
    __typename
  }
  privateMetadata {
    ...MetadataItem
    __typename
  }
  __typename
}

fragment TaxTypeFragment on TaxType {
  description
  taxCode
  __typename
}

fragment Product on Product {
  ...ProductVariantAttributesFragment
  ...MetadataFragment
  name
  slug
  descriptionJson
  seoTitle
  seoDescription
  defaultVariant {
    id
    __typename
  }
  category {
    id
    name
    __typename
  }
  collections {
    id
    name
    __typename
  }
  margin {
    start
    stop
    __typename
  }
  purchaseCost {
    start {
      ...Money
      __typename
    }
    stop {
      ...Money
      __typename
    }
    __typename
  }
  isAvailableForPurchase
  isAvailable
  isPublished
  chargeTaxes
  publicationDate
  pricing {
    priceRangeUndiscounted {
      start {
        gross {
          ...Money
          __typename
        }
        __typename
      }
      stop {
        gross {
          ...Money
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  images {
    ...ProductImageFragment
    __typename
  }
  variants {
    id
    sku
    name
    price {
      ...Money
      __typename
    }
    margin
    stocks {
      ...StockFragment
      __typename
    }
    trackInventory
    __typename
  }
  productType {
    id
    name
    hasVariants
    taxType {
      ...TaxTypeFragment
      __typename
    }
    __typename
  }
  weight {
    ...WeightFragment
    __typename
  }
  taxType {
    ...TaxTypeFragment
    __typename
  }
  availableForPurchase
  visibleInListings
  __typename
}

mutation ProductVariantSetDefault($productId: ID!, $variantId: ID!) {
  productVariantSetDefault(productId: $productId, variantId: $variantId) {
    errors: productErrors {
      ...ProductErrorFragment
      __typename
    }
    product {
      ...Product
      __typename
    }
    __typename
  }
}
